import React, { useEffect, useState } from 'react'
import Axios from 'axios'
import { Formulario } from './Formulario'

export const Ficha = (props) => {
    const {rut} = props
    const [datosFicha, setDatosFicha] = useState("")
    useEffect(() => {
        Axios.get(`https://api-rest-fedent.herokuapp.com/fichas-clinicas/${rut}`).then( (response) =>{
            if(response.status === 200){
                setDatosFicha(response.data[0])
            }   
        })
    }, [])
    return (
        <div className="container mt-3">
            {datosFicha === undefined?
            <div className="row" >
                <div className= "alert alert-warning alert-dismissible fade show col-12" role="alert">
                    Este usuario no posee ficha clinica 
                    <button type="button" className="close" data-dismiss="alert" aria-label="close">
                        <span aria-hidden="true">&times;</span>
                    </button>
                </div>
                <div className="col">
                    <Formulario rut={rut}/>
               </div>
            </div>

            :
            "existe"
            }
        </div>
    )
}
